import { BaseResourceModel } from './base-resource.model';
export class Pessoas extends BaseResourceModel {
  constructor(id, nome, fisicaJuridica, cpfCnpj, estadoCivil, genero, dataRegistro, nomeFantasia, objetoSocial, observacao, situacao) {
    super();
    this.id = id;
    this.nome = nome;
    this.fisicaJuridica = fisicaJuridica;
    this.cpfCnpj = cpfCnpj;
    this.estadoCivil = estadoCivil;
    this.genero = genero;
    this.dataRegistro = dataRegistro;
    this.nomeFantasia = nomeFantasia;
    this.objetoSocial = objetoSocial;
    this.observacao = observacao;
    this.situacao = situacao;
  }
  static fromJson(jsonData) {
    return Object.assign(new Pessoas(), jsonData);
  }
}
